  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:36.253254\",\n\t\"name\": \"chapter-6-biological-effects-of-the-reopening-of-the-san-luis-drain-to-carry-subsurface-ir\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In the second year of operation of the
  Grassland Bypass Project (GBP), the biological effects of contaminants improved
  in some geographic areas and worsened in others. In Mud Slough below the SLD outfall,
  selenium concentrations in fish trended downward (still at levels of concern), while
  selenium concentrations rose in some macroinvertebrates (waterboatmen). The release
  of drainwater into the wetlands channels feeding Salt Slough was sufficiently prolonged
  (Feb. 3-28,1998) to adversely affect contaminant concentrations in the Salt Slough
  ecosystem, temporarily reversing the improvement that occurred during the first
  year of the GBP. An assessment of selenium hazard to the aquatic ecosystems (Lemly
  index) in the Mud and Salt Slough areas indicates that the ecosystem hazard became
  more severe in both areas. This assessment is strongly influenced by transient maxima
  in water and sediment concentrations. Improvements continue to be seen with respect
  to selenium concentrations in both fish and invertebrates from the San Joaquin River
  sites. Continued biological monitoring is needed to distinguish long term trends
  from the temporary effects of an unusually wet winter and spring in the second year
  of the GBP.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
